import "./Blog1.scss";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import { NavLink, withRouter } from "react-router-dom";
import { connect } from "react-redux";
import React, { useState, useEffect } from "react";
import $ from "jquery";

function Fond({ text5 = [], displaymode1 }) {
  useEffect(() => {
    $(".navbar").css("position", displaymode1);
  });
  return (
    <>
      <Navbar />
      <div id="up" className="Blog1">
        <div className="gif">
          <img
            className="img1"
            src="https://i.ibb.co/tPBnk9P/qafqaz.gif"
            alt=""
          /> 
        </div>
     
      

        <div className="sectiontwo">
          <h1>Ox≈üar bloqlar</h1>
          <div className="blogcontent">
            <div className="blogdivs">
              {text5.map((tex) => {
                return (
                  <>
                    <div className="blogdiv">
                      <img src={tex.image} alt="" />
                      <div className="btitle">{tex.title}</div>
                    </div>
                  </>
                );
              })}
            </div>
          </div>
        </div>
      </div>



      <Footer />
    </>
  );
}

const mapStateToProps = (state, ownProps) => {
  return {
    text5: state.text5,
    displaymode1: state.displaymode1
  };
};

export default connect(mapStateToProps)(Fond);
